import React, { useState, useEffect } from "react";

function Logout() {
  const [user, setUser] = useState("");

  const handleClick = () => {
    useEffect(() => {
      fetch("http://localhost:3000/logout", {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
        },
      });
    });
  };
  return (
    <div>
      <button onClick={handleClick}>Logout</button>
    </div>
  );
}

export default Logout;
